import React from 'react';

const Nav = () => {
  return (
    <div className="Nav">
      <h2 style={{ display: 'inline' }}>Beyond</h2>
      <button>Log In</button>
      <button>Sign Up</button>
    </div>
  );
};

export default Nav;
